using System;
using System.Linq;
using System.Collections.Generic;

namespace SoftUniKaraoke
{
    class Program
    {
        static void Main(string[] args)
        {
            List<string> participants = Console.ReadLine().Split(", ").ToList();
            List<string> songs = Console.ReadLine().Split(", ").ToList();

            var info = new Dictionary<string, SortedSet<string>>();

            string command;
            while ((command = Console.ReadLine()) != "dawn")
            {
                string[] tokens = command.Split(", ");
                string participant = tokens[0], song = tokens[1], award = tokens[2];

                if (participants.Contains(participant) && songs.Contains(song))
                {
                    if (!info.ContainsKey(participant))
                    {
                        info[participant] = new SortedSet<string>();
                    }
                    info[participant].Add(award);
                }
            }

            if (info.Count > 0)
            {
                foreach (var i in info.OrderByDescending(x => x.Value.Count).ThenBy(x => x.Key))
                {
                    Console.WriteLine($"{i.Key}: {i.Value.Count} awards\n--" + String.Join("\n--", i.Value));
                }
            }
            else
            {
                Console.WriteLine("No awards");
            }
        }
    }
}

function softUniKaraoke(input) {
    let participants = input.shift().split(", "),
        songs = input.shift().split(", "),
        info = {};

    while (true) {
        let command = input.shift();
        if (command === "dawn") {
            break;
        }

        let [participant, song, award] = command.split(", ");

        if (participants.includes(participant) && songs.includes(song)) {
            if (!info.hasOwnProperty(participant)) {
                info[participant] = new Set();
            }
            info[participant].add(award);
        }
    }

    info = Object.fromEntries(
        Object.entries(info).sort((a, b) => b[1].size - a[1].size)
    );

    if (Object.keys(info).length > 0) {
        for (let key in info) {
            console.log(`${key}: ${info[key].size} awards`);
            for (let value of Array.from(info[key]).sort()) {
                console.log(`--${value}`);
            }
        }
    } else {
        console.log("No awards");
    }

    return;
}

#include <kit/all.hpp>
#include <stdio.h>
#include <stdlib.h>
#include <math.h>

using namespace kit;

#if defined(_DEBUG)
